    false,nt"url": null,nt"notes": "This narrative report for Lacreek Migratory
    Waterfowl Refuge outlines Refuge accomplishments from May through July of 1938.
    The report begins by summarizing the weather conditions, water conditions, and food
    and cover during this period. Wildlife- including migratory birds, upland game birds,
    predators, and rodents- is also covered. The Refuge development and maintenance
    section discusses physical developments, plantings, and collections and receipts.
    The public relations section discusses Refuge visitors. Photographs and N-R forms
    are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
